import React from 'react';
import {Card, Timeline} from "antd";

const TimelineCard = (props) => {
  return (
      <Timeline.Item>
        <Card
            size="small"
            title="Small size card"
            extra={<a href="#">More</a>}
            style={{ width: 300 }}
        >
          <p>Card content</p>
          <p>Card content</p>
          <p>Card content</p>
        </Card>
      </Timeline.Item>
  );
};

export default TimelineCard;
